import React from 'react'
import Todo from './Todo'
function TodoList({ todos, removeTodo }) {
    console.log(todos)
    return (
        <ol>
            {todos.map((todo) => (
                <Todo removeTodo={removeTodo} todo={todo} />
            ))}
        </ol>
    )
}

export default TodoList
